<template>
  <div class="container-app">
    <el-input
      v-model="search"
      @keyup.enter.native="searchItem"
      placeholder="Tìm kiếm tên | mã sản phẩm"
    ></el-input>
    <div v-loading="loadingData">
      <div
        class="box-item"
        v-for="(item, index) in data"
        :key="index"
        @click="viewListEm(item)"
      >
        <el-row :gutter="10">
          <el-col :span="3" v-if="index == 0 || index == 1 || index == 2">
            <img
              src="data:image/png;base64,
              
              
              
              
              
              
              
              
              
              
              "
              alt="product-hot"
            />
          </el-col>
          <el-col :span="index == 0 || index == 1 || index == 2 ? 15 : 18">
            <p class="product">{{ item.ProductName }}</p>
            <p class="id">{{ item.ProductID }}</p>
          </el-col>
          <el-col :span="6">
            <p class="count">
              {{ item.CountEm }}
              <i class="el-icon-user"></i>
            </p>
          </el-col>
        </el-row>
      </div>
      <el-dialog :visible.sync="dialogForm" custom-class="view-modal">
        <h3 class="title-view" slot="title">
          <span>{{ titleDialog }}</span>
          <p>{{ rowData.ProductID }}</p>
        </h3>
        <modal-info :item="rowData"></modal-info>
      </el-dialog>
    </div>
  </div>
</template>

<script>
import { GetProductSale } from "@/api/saleHeader";
import ModalInfo from "./component/modal-info";
export default {
  components: { ModalInfo },
  data() {
    return {
      data: [],
      dataLst: [],
      username: "",
      token: "",
      search: "",
      dialogForm: false,
      loadingData: false,
      titleDialog: "",
      rowData: ""
    };
  },
  methods: {
    fetchData() {
      this.loadingData = true;
      const req = {
        UserName: this.username,
        Token: this.token
      };
      GetProductSale(req).then(res => {
        if (res.RespCode == 0) {
          this.data = res.ProductSaleLst;
          this.dataLst = res.ProductSaleLst;
          this.loadingData = false;
        }
      });
    },
    viewListEm(item) {
      this.dialogForm = true;
      this.titleDialog = item.ProductName;
      this.rowData = item;
    },
    searchItem() {
      this.data = this.dataLst.filter(
        data =>
          !this.search ||
          data.ProductName.toLowerCase().includes(this.search.toLowerCase()) ||
          data.ProductID.toLowerCase().includes(this.search.toLowerCase())
      );
    }
  },
  created() {
    this.token = this.$route.params.token;
    this.username = this.$route.params.username;
    this.fetchData();
  },
  watch: {
    search() {
      this.searchItem();
    }
  }
};
</script>

